import React from 'react';
import classes from './Meal.module.css';

//食物组件
const Meal = () => {
	return (
		<div className={classes.Meal}>
			<div>
				<img src="../../../../public/img/1.png" alt="" />
			</div>
			<div>
				<h2>奇异果</h2>
				<p>维c</p>
			</div>
		</div>
	);
};

export default Meal;
